import logo from './logo.svg';
import './App.css';

function Header(){
  return(
    <nav className='nav-bar'>
    <p>Logo</p>
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/">Contact</a>
      </li>
    </ul>
  </nav> 
  )
}

function App() {
  return (
    <div>
      <Header />
        <h1>Homepage</h1>
        <p>This is the homepage.</p>
    </div>    
  );
}

export default App;
